import React, { useState } from 'react';

const PortfolioSection = () => {
    const [activeTab, setActiveTab] = useState('editorial');

    const handleTabChange = (tab) => {
        setActiveTab(tab);
    };

    const renderTabContent = () => {
        switch (activeTab) {
        case 'editorial':
            return <div>Editorial Photos</div>;
        case 'wedding':
            return <div>Wedding Photos</div>;
        case 'travel':
            return <div>Travel Photos</div>;
        case 'fashion':
            return <div>Fashion Photos</div>;
        case 'lifestyle':
            return <div>Lifestyle Photos</div>;
        case 'beauty':
            return <div>Beauty Photos</div>;
        default:
            return null;
        }
    };

    return (
        <section className='p-20'>
            <h2 className='font-semibold text-3xl w-full text-center uppercase'>
                Portfolio
            </h2>
            <div>
                <button
                    onClick={() => handleTabChange('editorial')}
                    className={activeTab === 'editorial' ? 'active' : ''}
                >
                    Editorial
                </button>
                <button
                    onClick={() => handleTabChange('wedding')}
                    className={activeTab === 'wedding' ? 'active' : ''}
                >
                Wedding
                </button>
                <button
                onClick={() => handleTabChange('travel')}
                className={activeTab === 'travel' ? 'active' : ''}
                >
                Travel
                </button>
                <button
                onClick={() => handleTabChange('fashion')}
                className={activeTab === 'fashion' ? 'active' : ''}
                >
                Fashion
                </button>
                <button
                onClick={() => handleTabChange('lifestyle')}
                className={activeTab === 'lifestyle' ? 'active' : ''}
                >
                Lifestyle
                </button>
                <button
                onClick={() => handleTabChange('beauty')}
                className={activeTab === 'beauty' ? 'active' : ''}
                >
                Beauty
                </button>
            </div>
            <div>{renderTabContent()}</div>
        </section>
    );
};

export default PortfolioSection;
